import React from 'react';
import Button from '@material-ui/core/Button';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    return(
        <div>
            {gotoPrevPage && <Button 
            className="prevpage"
            onClick={gotoPrevPage}>
                Previous Page
            </Button>}
            {gotoNextPage && <Button 
            className="nextpage"
            onClick={gotoNextPage}>
                Next Page
            </Button>}
        </div>
    )
}

export default Pagination;
